package org.zkoss.zktest.test2.F86

import org.junit.Test
import org.zkoss.zstl.ZTL4ScalaTestCase;

class F86_ZK_3913Test extends ZTL4ScalaTestCase {
	var dataUrl = "data:image/png;base64,"

	var dataUrl2 = "data:image/png;base64,"
	@Test
	def test() = {
		runZTL(() => {
			verifyEquals(3, jq("canvas").length)

			val canvasjq = jq("canvas:eq(0)")
			var height = canvasjq.height();
			var width = canvasjq.width();
			verifyEquals(100, height)
			verifyEquals(114, width)
			var data = canvasjq.toElement().eval("toDataURL()");
			waitResponse()
			verifyEquals(dataUrl, data)

			click(jq("$act1"))
			waitResponse()

			height = canvasjq.height();
			width = canvasjq.width();
			verifyEquals(100, height)
			verifyEquals(532, width)
			data = canvasjq.toElement.eval("toDataURL()");
			waitResponse()
			verifyEquals(dataUrl2, data)
		})
	}
}
